) Next, we'll need a Clock, which will allow us to fake timing in our tests. // CronJobReconciler reconciles a CronJob object
type CronJobReconciler struct { client.Client Log logr.Logger Scheme *runtime.Scheme Clock
} Clock We'll mock out the clock to make it easier to jump around in time while testing, the "real" clock just calls time.Now. type realClock struct{} func (_ realClock) Now() time.Time { return time.Now() } // clock knows how to get the current time.
// It can be used to fake out timing for testing.
type Clock interface { Now() time.Time
} Notice that we need a few more RBAC permissions -- since we're creating and managing jobs now, we'll need permissions for those, which means adding a couple more markers . // +kubebuilder:rbac:groups=batch.tutorial.kubebuilder.io,resources=cronjobs,verbs=get;list;watch;create;update;patch;delete
